/// LIVE STREAMER | VIDEO CREATOR \\\
My name is David Foster. I want to welcome you to my channel! I work with content creators, podcasters, YouTubers, and more to help make their content more PRO. Join me on my LIVE streams for OPEN Q&A and get your questions answered. 

/// MY GEAR \\\ 
I use a LOT of gear. If you want to see what I am using, you can see it on my website: https://davidfostermedia.com/tools.

/// BUSINESS INQUIRIES \\\
Please email me at david@DavidFosterMedia.com. I will NOT do a product review for a free product. I will not review a product I have not personally used or heard good things from someone I trust.
